import React from 'react';

function PizzaBlock({ pizzas }) {
  return (
    <div className="pizza-block">
      {pizzas &&
        pizzas.map((pizza) => {
          console.log(pizza);
        })}
    </div>
  );
}

export default PizzaBlock;
